window.bookSummaryJSON = "<p><b>One bad roll catapults them into a new world...</b></p> <p>Five friends, gamers for life, gather for their usual game night. Yet, when they use a strange new die they are transported to a fantasy world where all gaming ideas can come true.</p> <p>Together, the party must join forces to deal with the vile Necrolord whose plans will not only threaten this world, but Earth as well. Should be easy for a team of adventurers, but when gaming and real life meet, there are situations which cannot be anticipated.</p> <p>Will Samo use science to solve all her problems? Will Wyatt always resort to violence? Will Bourbon discover lost treasure? Will Falcon restore his kingdom. Will Melf, the bard, find his pants?</p> <p><b>All questions and more will be answered in the </b><b><i>Fifth Era Apocalypse!</i></b><b> A new action-packed and hilarious LitRPG Adventure from Ryan Rimmel, bestselling author of </b><b><i>Noobtown.</i></b></p>"; 
